import hashlib
# import serial

data = "abc"
print('sha256 abc')
data_sha256 = hashlib.sha256(data.encode('utf-8')).hexdigest()
print(data_sha256)

print('sha384 abc')
data_sha384 = hashlib.sha384(data.encode('utf-8')).hexdigest()
print(data_sha384)


dataLong = ''
print('sha256 0xAE 61440')
data_sha256_AE = hashlib.sha256(dataLong.encode('utf-8')).hexdigest()
print(data_sha256_AE)

print('sha384 0xAE 61440')
data_sha384_AE = hashlib.sha384(dataLong.encode('utf-8')).hexdigest()
print(data_sha384_AE)

